    echo 'No mel-ewe dump files found.' . PHP_EOL;
    return 1;
}
$targetDir = $targetDir.'\\'.$subFolders[0];
$files = @scandir($targetDir, 1);
if (empty($files) || count($files) < 2) {
    echo 'Mel-ewe dump files are missing.' . PHP_EOL;
    return 1;
}
$pressures = file_get_contents($targetDir.'\\' . $files[0]);
