function transposeArray(array $inputArray, bool $oneBased = false)
{
    $outputArray = [];
    foreach ($inputArray as $row => $columns) {
        foreach ($columns as $col => $value) {
            $outputArray[$col + ($oneBased ? 1 : 0)][$row + ($oneBased ? 1 : 0)] = $value;
        }
    }
    return $outputArray;
}
